  @media (max-width: $grid-float-breakpoint) {
    left: 30px;
    top: -5px;
    width: calc(100% - 30px);
  }
  &:before,
  &:after {
    content: "";
    position: absolute;
  }
  &:before {
    border-bottom:11px solid $color-pf-black-400;
    border-left:11px solid transparent;
    border-right:11px solid transparent;
    right: 35px;
    .toolbar-pf-find:last-child & {
      right: 15px;
    }
    top: -12px;
    @media (max-width: $grid-float-breakpoint) {
      border-bottom:11px solid transparent;
      border-right:11px solid $color-pf-black-400;
      border-top:11px solid transparent;
      left: -22px;
      right: initial;
      top: 8px;
    }
  }
  &:after {
    border-bottom:10px solid $color-pf-white;
    border-left:10px solid transparent;
    border-right:10px solid transparent;
    right: 36px;
    .toolbar-pf-find:last-child & {
      right: 16px;
    }
    top: -10px;
    @media (max-width: $grid-float-breakpoint) {
      border-bottom:10px solid transparent;
      border-right:10px solid $color-pf-white;
      border-top:10px solid transparent;
      left: -20px;
      right: initial;
      top: 9px;
    }
  }
  input {
    height: 30px;
    padding: 5px 117px 5px 5px; // 112px (components) + 5px (offset)
    width: 100%;
  }
  .find-pf-buttons {
    position: absolute;
    right: 10px;
    top: 5px;
    .btn {
      border: none;
      cursor: pointer;
      margin-left: 0 !important;
      padding: 0;
      width: 18px;
      .fa-angle-up,
      .fa-angle-down {
        font-weight: bold;
        font-size: ($font-size-base + 6);
      }
      .pficon-close { font-size: ($font-size-base + 2); }
    }
    span {
      height: 30px;
      line-height: 30px;
      vertical-align: middle;
    }
    .find-pf-nums {
      color: $color-pf-black-500;
      margin-right: 3px;
    }
  }
}

.toolbar-pf-results {
  border-top: 1px solid $sidebar-pf-border-color;
  margin-top: ($grid-gutter-width/4);
  h5,
  p,
  ul {
    display: inline-block;
    line-height: ($grid-gutter-width/1.5);
    margin-bottom: 0;
    margin-top: 0;
    @media (min-width: $screen-sm-min) {
      line-height: $grid-gutter-width;
