  border: none;
  font-size: $font-size-base;
  margin: 0;
  padding-right: $padding-large-horizontal;
  width: auto;
  .fa-angle-right {
    cursor: pointer;
    font-size: $font-size-large;
    width: $font-size-large;
  }
}

.form-control-pf-editable {
  display: flex;
  &.form-control-pf-full-width {
    display: block;
    > .form-control-pf-value {
      text-align: left;
    }
    .action-buttons {
      float: right;
    }
  }
  &.form-control-pf-edit {
    > .form-control-pf-value {
      display: none;
    }
    > :not(.form-control-pf-value):not(.spinner),
    > .bootstrap-select.btn-group:not(.input-group-btn) {
      display: inline-block;
    }
  }
  &.form-control-pf-updating {
    > .spinner {
      display: inline-block;
    }
    > :not(.spinner) {
      display: none;
    }
  }
  > .form-control-pf-value {
    background: none;
    border: 1px solid transparent;
    display: inline-block;
    padding: $padding-base-vertical $padding-base-horizontal;
    &:focus {
      border-color: $color-pf-black-400;
    }
    &:hover {
      border-color: $color-pf-black-400;
      cursor: pointer;
    }
    + :not(textarea) {
      flex: 1;
    }
    i {
      margin-left: $padding-base-horizontal;
    }
  }
  > :not(.form-control-pf-value) {
    display: none;
  }
  > .form-control-pf-textbox {
    position: relative;
    input {
      padding-right: $input-height-base;
    }
    .form-control-pf-empty {
      background: none;
      border: none;
      color: $color-pf-black-400;
      height: 100%;
      position: absolute;
      right: 0;
      top: 0;
    }
  }
  > .btn {
    margin-left: 3px;
  }
  > .spinner {
    margin: (($input-height-base - ($font-size-base * 1.5)) * .5) 0;
  }
  > .bootstrap-select.btn-group:not(.input-group-btn) {
    display: none;
  }
  > textarea {
    display: block;
    min-height: 84px;
    resize: vertical;
  }
}
